import React from 'react';
import AppIcon from '../components/AppIcon.js';


class Landing extends React.Component {
    constructor(props) {
        super(props);
        console.log(props.functions);
    }
    render(){
        const buttonList = [
            "Contacts", "Rules", "Map", "Stats", "Chatroom", "Settings"
        ];
        console.log(this.props.functions[[buttonList[0]]]);
        const apps = buttonList.map((button) =>
            <div className={"app "+ button} id={button+"Button"}>
                <button className={"appButton"} id={button+"Button"} onClick={() => this.props.functions[button]}>
                    <AppIcon app={button}/>
                    <p>{button}</p>
                </button>
            </div>
        );
        return(
            <div className="landingOverlay">
                <div className="landingMenu">
                    <div className="landingGrid"> 
                        {apps}
                    </div>
                </div>
                <div className='landingBackground'></div>
                <div className="loadingAnimation">

                </div>
                <div className='activeApp'>

                </div>
            </div>
        );
    }
} export default Landing;
